import React, { useState, useEffect } from 'react';

function App() {
  const [dat, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000", {
      'methods': 'GET',
      headers: {
        'Content-Type':'applications/json'
      }
    }).then(
    )
  })
  return (
    <div>
      <h1>Members:</h1>
      <ul>
        {dat.map((member, index) => (
          <li key={index}>{member}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
